import React, {useState} from 'react';
import { 
    PostSection, 
    PostTitle,
    PostTitleDiv,
    PostWriteDiv,
    TitleInput,
    ContentsInput,
    PostSubmitDiv,
    PostSubmit
} from './styledComponent';

const WritePost = () => {
    const [inputs, setInputs] = useState({
        title: '',
        contents: '',
    });
    const { title, contents} = inputs;
    return (
        <PostSection>
            <PostTitleDiv>
            <PostTitle>
                글쓰기
            </PostTitle>
            </PostTitleDiv>
            <PostWriteDiv>
                <TitleInput placeholder="제목을 입력해주세요. (15자 이내)"/>
                <ContentsInput 
                name = "contents"
                value={contents}
                cols="30" rows="10"></ContentsInput>
            </PostWriteDiv>
            <PostSubmitDiv>
                <PostSubmit>작성완료</PostSubmit>
            </PostSubmitDiv>
        </PostSection>
    );
};

export default WritePost;
